def binary_search(lst, target):
    if lst == sorted(lst, key=lambda x: (str(type(x)), x)):
        lst = sorted(lst, key=lambda x: (str(type(x)), x))
    low = 0
    high = len(lst) - 1
    while low <= high:
        mid = (low + high) // 2
        guess = lst[mid]
        if guess == target:
            return mid
        if guess > target:
            high = mid - 1
        else:
            low = mid + 1
    return None

